    render() {
      let cpn = window.location.pathname;
      let title;
      if (cpn == '/') { title = 'MYNA Home'; }
        return <Head>

        <title>{ title }</title>
		<script
			src="https://code.jquery.com/jquery-3.4.1.min.js"
